import "./Introduction.css";
import Submenubar from "../../Components/Submenubar";
import { Routes, Route } from "react-router-dom";
import CEO_hello from "./CEO_hello";
import Company_intro from "./Company_intro";

function Introduction() {
  const submenus = [
    ["CEO 인사말", "/introduction/ceo_hello/"],
    ["회사소개", "/introduction/company_intro/"],
  ];
  return (
    <>
      <Submenubar submenus={submenus} />
      <h1>Introduction!</h1>
      <Routes>
        <Route path="/introduction/ceo_hello" element={<CEO_hello />} />
        <Route path="/introduction/company_intro" element={<Company_intro />} />
      </Routes>
    </>
  );
}

export default Introduction;
